import React from 'react';

function FetchCity(city){

    const data = componentDidMount(city)

    return (
        <div>
            lat: {data.geonames[1].lat},
            lng: data.geonames[1].lng,
            country: data.geonames[1].countryName
        </div>
    )
}

async function componentDidMount(city){
        const response = await fetch("http://api.geonames.org/searchJSON?name_equals=" + city + "&username=DestinationFinder");
        const data = await response.json();
        return data
    }

export default FetchCity
